import randomColor from 'randomcolor';

const RepoPage = () => {
  return (
    <div className="RepoPage_GridA1">
        
        <Grid container xs={2} style={{background:randomColor({hue:'red'})}} direction="column" alignItems="center" >
          
          <Grid item xs={10} style={{background:randomColor({hue:'green'})}} sx={{ margin: 2, padding: 2,  paddingTop: 2, paddingLeft: 3, paddingRight: 3, marginTop: 2, marginBottom: 2}} spacing = {2} padding={1} justifyContent="center" alignItems="center" spacing={0}>  
            Hooray nothing is here!
          </Grid>
          
          <Grid item xs={2} style={{background:randomColor({hue:'green'})}}>
            Hooray nothing is here!
          </Grid>

          
          <Grid item xs={2} style={{background:randomColor({hue:'green'})}}>
            Hooray nothing is here!
          </Grid>

          <Grid item xs={2} style={{background:randomColor({hue:'green'})}}>
            Hooray nothing is here!
          </Grid>

        </Grid>
        
    </div>
  );
};



export default RepoPage;
